# In portrait mode, FrameBuffer has two horizontal modes HLSB & HMSB, with different bits direction
# In landscape mode, FrameBuffer has only one mode, which is the wrong one for the ePaper 2.13
# the reverse function reverses the bits direction, using a lookup table (simple & fast)
lookup = [
    0x0, 0x8, 0x4, 0xc, 0x2, 0xa, 0x6, 0xe, 0x1, 0x9, 0x5, 0xd, 0x3, 0xb, 0x7, 0xf
]


def reverse(n):
    return (lookup[n & 0b1111] << 4) | (lookup[n >> 4])


EPD_WIDTH = 250
EPD_HEIGHT = 128  # height is really 122 pixels, but the code needs it to be divisible by 8

RST_PIN = 12
DC_PIN = 8
CS_PIN = 9
BUSY_PIN = 13

FULL_UPDATE = 0
PART_UPDATE = 1


class EPD_2in13(framebuf.FrameBuffer):
    def __init__(self):
        self.reset_pin = Pin(RST_PIN, Pin.OUT)

        self.busy_pin = Pin(BUSY_PIN, Pin.IN, Pin.PULL_UP)
        self.cs_pin = Pin(CS_PIN, Pin.OUT)
        self.width = EPD_WIDTH
        self.height = EPD_HEIGHT

        self.full_lut = lut_full_update
        self.partial_lut = lut_partial_update

        self.full_update = FULL_UPDATE
        self.part_update = PART_UPDATE

        self.spi = SPI(1)
        self.spi.init(baudrate=4000_000)
        self.dc_pin = Pin(DC_PIN, Pin.OUT)

        self.buffer = bytearray(self.height * self.width // 8)
        super().__init__(self.buffer, self.width, self.height, framebuf.MONO_VLSB)
        self.init(FULL_UPDATE)

    def digital_write(self, pin, value):
        pin.value(value)

    def digital_read(self, pin):
        return pin.value()

    def delay_ms(self, delaytime):
        utime.sleep(delaytime / 1000.0)

    def spi_writebyte(self, data):
        self.spi.write(bytearray(data))

    def module_exit(self):
        self.digital_write(self.reset_pin, 0)

    # Hardware reset
    def reset(self):
        self.digital_write(self.reset_pin, 1)
        self.delay_ms(50)
        self.digital_write(self.reset_pin, 0)
        self.delay_ms(2)
        self.digital_write(self.reset_pin, 1)
        self.delay_ms(50)

    def send_command(self, command):
        self.digital_write(self.dc_pin, 0)
        self.digital_write(self.cs_pin, 0)
        self.spi_writebyte([command])
        self.digital_write(self.cs_pin, 1)

    def send_data(self, data):
        self.digital_write(self.dc_pin, 1)
        self.digital_write(self.cs_pin, 0)
        self.spi_writebyte([data])
        self.digital_write(self.cs_pin, 1)

    def ReadBusy(self):
        print('busy')
        while (self.digital_read(self.busy_pin) == 1):  # 0: idle, 1: busy
            self.delay_ms(10)
        print('busy release')

    def TurnOnDisplay(self):
        self.send_command(0x22)
        self.send_data(0xC7)
        self.send_command(0x20)
        self.ReadBusy()

    def TurnOnDisplayPart(self):
        self.send_command(0x22)
        self.send_data(0x0c)
        self.send_command(0x20)
        self.ReadBusy()

    def init(self, update):
        print('init')
        self.reset()
        if (update == self.full_update):
            self.ReadBusy()
            self.send_command(0x12)  # soft reset
            self.ReadBusy()

            self.send_command(0x74)  # set analog block control
            self.send_data(0x54)
            self.send_command(0x7E)  # set digital block control
            self.send_data(0x3B)

            self.send_command(0x01)  # Driver output control
            self.send_data(0x27)
            self.send_data(0x01)
            self.send_data(0x01)

            self.send_command(0x11)  # data entry mode
            self.send_data(0x01)

            self.send_command(0x44)  # set Ram-X address start/end position
            self.send_data(0x00)
            self.send_data(0x0F)  # 0x0C-->(15+1)*8=128

            self.send_command(0x45)  # set Ram-Y address start/end position
            self.send_data(0x27)  # 0xF9-->(249+1)=250
            self.send_data(0x01)
            self.send_data(0x2e)
            self.send_data(0x00)

            self.send_command(0x3C)  # BorderWavefrom
            self.send_data(0x03)

            self.send_command(0x2C)  # VCOM Voltage
            self.send_data(0x55)  #

            self.send_command(0x03)
            self.send_data(self.full_lut[70])

            self.send_command(0x04)  #
            self.send_data(self.full_lut[71])
            self.send_data(self.full_lut[72])
            self.send_data(self.full_lut[73])

            self.send_command(0x3A)  # Dummy Line
            self.send_data(self.full_lut[74])
            self.send_command(0x3B)  # Gate time
            self.send_data(self.full_lut[75])

            self.send_command(0x32)
            for count in range(70):
                self.send_data(self.full_lut[count])

            self.send_command(0x4E)  # set RAM x address count to 0
            self.send_data(0x00)
            self.send_command(0x4F)  # set RAM y address count to 0X127
            self.send_data(0x0)
            self.send_data(0x00)
            self.ReadBusy()
        else:
            self.send_command(0x2C)  # VCOM Voltage
            self.send_data(0x26)

            self.ReadBusy()

            self.send_command(0x32)
            for count in range(70):
                self.send_data(self.partial_lut[count])

            self.send_command(0x37)
            self.send_data(0x00)
            self.send_data(0x00)
            self.send_data(0x00)
            self.send_data(0x00)
            self.send_data(0x40)
            self.send_data(0x00)
            self.send_data(0x00)

            self.send_command(0x22)
            self.send_data(0xC0)
            self.send_command(0x20)
            self.ReadBusy()

            self.send_command(0x3C)  # BorderWavefrom
            self.send_data(0x01)
        return 0

    def display(self, image):
        self.send_command(0x24)
        h = int(self.height / 8)
        for j in range(0, self.width):
            for i in range(0, h):
                self.send_data(reverse(image[i * self.width + (self.width - j - 1)]))
        self.TurnOnDisplay()

    def displayPartial(self, image):
        self.send_command(0x24)
        h = int(self.height / 8)
        for j in range(0, self.width):
            for i in range(0, h):
                self.send_data(reverse(image[i * self.width + (self.width - j - 1)]))

        self.send_command(0x26)
        for j in range(0, self.width):
            for i in range(0, h):
                self.send_data(~reverse(image[i * self.width + (self.width - j - 1)]))
        self.TurnOnDisplayPart()

    def displayPartBaseImage(self, image):
        self.send_command(0x24)
        h = int(self.height / 8)
        for j in range(0, self.width):
            for i in range(0, h):
                self.send_data(reverse(image[i * self.width + (self.width - j - 1)]))

        self.send_command(0x26)
        for j in range(0, self.width):
            for i in range(0, h):
                self.send_data(reverse(image[i * self.width + (self.width - j - 1)]))
        self.TurnOnDisplay()

    def Clear(self, color):
        self.send_command(0x24)
        h = int(self.height / 8)
        for j in range(0, self.width):
            for i in range(0, h):
                self.send_data(color)
        self.send_command(0x26)
        for j in range(0, self.width):
            for i in range(0, h):
                self.send_data(color)

        self.TurnOnDisplay()

    def sleep(self):
        self.send_command(0x10)  # enter deep sleep
        self.send_data(0x03)
        self.delay_ms(2000)
        self.module_exit()


# now onto the code itself

def STA_Setup(ssidRouter, passwordRouter, sta_if):
    if not sta_if.isconnected():
        print('connecting to', ssidRouter)
        sta_if.active(True)
        sta_if.connect(ssidRouter, passwordRouter)
        attempt = 0
        while attempt < 15 and not sta_if.isconnected():
            attempt += 1
            print(str(attempt))
            utime.sleep(1.0)
        if sta_if.isconnected():
            print('Connected, IP address:', sta_if.ifconfig())
        else:
            print('Could not connect')
    return sta_if


def init(epd):
    epd.Clear(0xff)
    epd.fill(0xff)
    epd.fill_rect(50, 0, 2, 122, 0x00)
    epd.display(epd.buffer)
    epd.init(epd.part_update)


def inittime():
    if not sta_if.isconnected():
        STA_Setup(ssidRouter, passwordRouter, sta_if)
    if sta_if.isconnected():
        try:
            resp = urequests.get(TIME_URL).json()
            # from https://forum.micropython.org/viewtopic.php?f=15&t=9706
            (year, month, day, hour, minute, second, wday, yday) = utime.localtime(
                resp["unixtime"] + resp["raw_offset"])
            machine.mem32[rtc_base_mem + 4] = (year << 12) | (month << 8) | day
            machine.mem32[rtc_base_mem + 8] = ((hour << 16) | (minute << 8) | second) | (((wday + 1) % 7) << 24)
            machine.mem32[rtc_base_mem + atomic_bitmask_set + 0xc] = 0x10
            utime.sleep(1) # needs a second for the internal clock to be updated
        except:  # give up
            pass


def on2(s):
    s = str(s)
    if len(s) == 0:
        return "00"
    elif len(s) == 1:
        return "0" + s
    else:
        return s


pi2 = math.pi / 2.0


def drawLine(epd, cx, cy, rad, pct):
    x = math.cos(pi2 + -2 * math.pi * pct)
    y = -1 * math.sin(pi2 + -2 * math.pi * pct)
    epd.line(cx, cy, int(cx + x * rad), int(cy + y * rad), 0x00)


