def loop(sta_if, epd):
    lastm = ""
    lasth = ""
    while True:
        t = utime.localtime()
        h = str(t[0]) + ':' + str(t[1]) + ':' + str(t[2]) + ':' + str(t[3])
        m = h + ':' + str(t[4])
        if m != lastm:
            if t[0] == 2021 and t[1] == 1 and t[2] == 1:  # time is not right, set up from network
                inittime()
            else:
                lastm = m
                epd.fill_rect(0, 0, 47, 122, 0xff)
                epd.text(on2(t[3]) + ":" + on2(t[4]), 2, 0, 0x00)
                epd.text(daysOfWeek[t[6]], 0, 94, 0x00)
                epd.text(on2(t[2]) + "/" + on2(t[1]), 2, 109, 0x00)
                epd.ellipse(22, 41, 21, 21, 0x00)
                epd.ellipse(22, 41, 22, 22, 0x00)
                epd.line(0, 41, 3, 41, 0x00)
                epd.line(42, 41, 45, 41, 0x00)
                epd.line(22, 19, 22, 22, 0x00)
                epd.line(22, 61, 22, 64, 0x00)
                drawLine(epd, 22, 41, 21, t[4] / 60)
                drawLine(epd, 22, 41, 10, t[3] / 12)
                drawLine(epd, 22, 41, 10, t[3] / 12 + 0.015)
                drawLine(epd, 22, 41, 10, t[3] / 12 - 0.015)
                epd.displayPartial(epd.buffer)
        if h != lasth:
            if not sta_if.isconnected():
                STA_Setup(ssidRouter, passwordRouter, sta_if)
            if not sta_if.isconnected():
                continue
            lasth = h
            epd.fill_rect(54, 0, 196, 122, 0xff)
            try:
                resp = urequests.get(WEATHER).json()
                epd.text(resp["weather"][0]["description"], 56, 0, 0x00)
                ico = resp["weather"][0]["icon"][0:2]
                if ico in icons:
                    fbuf = framebuf.FrameBuffer(icons[ico], 50, 50, framebuf.MONO_HLSB)
                    epd.blit(fbuf, 200, 25)
                epd.fill_rect(56, 13, 194, 1, 0x00)
                epd.text("Temp:  " + str(resp["main"]["temp"]) + "c", 56, 19, 0x00)
                epd.text("Feels: " + str(resp["main"]["feels_like"]) + "c", 56, 34, 0x00)
                epd.text("Min:   " + str(resp["main"]["temp_min"]) + "c", 56, 49, 0x00)
                epd.text("Max:   " + str(resp["main"]["temp_max"]) + "c", 56, 64, 0x00)
                epd.text("Pressure: " + str(resp["main"]["pressure"]) + "hPa", 56, 94, 0x00)
                epd.text("Humidity: " + str(resp["main"]["humidity"]) + "%", 56, 109, 0x00)
            except:
                # give up
                pass
            epd.displayPartial(epd.buffer)
        epd.delay_ms(1000)


if __name__ == '__main__':
    sta_if = network.WLAN(network.STA_IF)
    epd = EPD_2in13()
    init(epd)
    loop(sta_if, epd)
